          "placeId": "ChIJYd1uW9IEdkgRF6OuVnyD6B0",
          "description": "\nThe virus that causes COVID-19 is mainly transmitted through droplets generated when an infected person coughs, sneezes, or exhales. These droplets are too heavy to hang in the air, and quickly fall on floors or surfaces.",
          "image": "/images/project/7863c6e7-cff5-434e-99b2-cca82c4e5c63-1603959258923.jpeg",
