        "user_post": "The Manimahesh Lake is situated Twenty-six kilometers from Bharmour in the Budhil valley , one of the chief pilgrimage spots in Himachal Pradesh. The lake is situated at an altitude of 13,000 feet at the foot of the Kailash peak (18,564 ft). Every year, on the eighth day of the light half of the moon in the month of Bhadon, a fair is held at this lake, which attracts thousands of pilgrims who assemble here to take a dip in the holy water.",
